import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, StyleSheet, Text, TextInput } from 'react-native';
import { RectButton, ScrollView } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import CardUsuario from '../../components/CardUsuario/CardUsuario';

import styles from './estilo';

export default function tCadastrarInfo() {
    const navigation = useNavigation();

    function Avancao() {
        navigation.navigate('tCadastrarFoto')
    }

    function Voltar() {
        navigation.goBack()
    }

    const [usuarios, setUsuarios] = useState([]);

    useEffect(() => {
        fetch("https://localhost:44396/api/cuidadores", {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify({
                // Coloque aqui os dados que deseja enviar no corpo da requisição
            })
        })
            .then((response) => response.json())
            .then((json) => {
                setUsuarios(json);
            })
            .catch((error) => {
                console.log(error);
                alert("Erro ao buscar usuários");
            });
    }, []);

    const [nome, setnome] = useState('');
    const [dataNascimento, setdata_de_nasc] = useState('');
    const [cpf, setcpf] = useState('');
    const [celular, setcelular] = useState('');
    const [endereco, setendereco] = useState('');
    const [cidade, setcidade] = useState('');
    const [estado, setestado] = useState('');
    const [email, setemail] = useState('');
    const [senha, setsenha] = useState('');

    return (
        <ImageBackground style={styles.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Sejam Bem-vindo(a)</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>
                    <TextInput
                        style={styles.input}
                        placeholder="Nome Completo"
                        value={nome}
                        onChangeText={setnome}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Data de Nascimento"
                        autoCorrect={false}
                        value={dataNascimento}
                        onChangeText={setdata_de_nasc}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="CPF"
                        value={cpf}
                        onChangeText={setcpf}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Celular"
                        value={celular}
                        onChangeText={setcelular}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Endereço"
                        value={endereco}
                        onChangeText={setendereco}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Cidade"
                        value={cidade}
                        onChangeText={setcidade}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Estado"
                        value={estado}
                        onChangeText={setestado}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="E-mail"
                        value={email}
                        onChangeText={setemail}
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Senha"
                        value={senha}
                        onChangeText={setsenha}
                    />
                </View>
            </ScrollView>
            <View>
                <RectButton style={styles.buttonNext} onPress={Avancao}>
                    <Text style={styles.buttonText}>Avançar</Text>
                </RectButton>
                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground>
    );
}
